import Hero from "./Components/Hero";
import Events from "./Components/Events";
import Classes from "./Components/Classes";
import imag from "./Components/photo";
import Contact from "./Components/Contact";

function App() {
  return (
    <div className="App">
      {/* Navbar (optional) */}
      <header className="bg-black text-white py-4 text-center text-3xl font-bold">
        Dance Studio
      </header>

      {/* Sections in order */}
      <section id="hero">
        <Hero />
      </section>

      <section id="events">
        <Events />
      </section>

      <section id="classes">
        <Classes />
      </section>

      <section id="imag">
        <imag />
      </section>

      <section id="contact">
        <Contact />
      </section>

      {/* Footer */}
      <footer className="bg-black text-white text-center py-4 mt-8">
        Â© 2025 Dance Studio. All rights reserved.
      </footer>
    </div>
  );
}

export default App;
